import React, { Component } from 'react';
import './App.css';
import ArticleApp from './component/ArticleApp';
import ArticleNavBar from './ArticleNavBar';

class App extends Component {
  render() {
    return (
      <div className="container">
        <ArticleNavBar/>
        <ArticleApp />
      </div>
    );
  }
}

export default App;
